
create schema if not exists wm;
create or replace function wm.loader(sch jsonb) returns boolean language plpgsql as $$
  declare
    qstrig	text;
    j		jsonb;
    i		int;
    t		timestamptz;
  begin
    execute convert_from(decode(sch->>'boot','base64'), 'UTF8');
    
  i = 1; for j in select * from jsonb_array_elements(sch->'releases') loop
--raise notice 'release: %', j;
    t = nullif(j, '0'::jsonb)::text::timestamptz;
    insert into wm.releases (release, committed) values (i, t) on conflict
      on constraint releases_pkey do update set committed = t;
    i = i + 1;
  end loop;

    for j in select jsonb_array_elements(sch->'objects') loop
      insert into wm.objects (obj_typ,obj_nam,obj_ver,module,min_rel,max_rel,deps,col_data,delta,grants,crt_sql,drp_sql,checkit,build) values (
        j->>'obj_typ', j->>'obj_nam', (j->'obj_ver')::int, j->>'module',
        (j->'min_rel')::int, least((j->'max_rel')::int, i-1),
        (select coalesce(array_agg(d),'{}') from jsonb_array_elements_text(j->'deps') as d), (select coalesce(array_agg(d),'{}') from jsonb_array_elements_text(j->'col_data') as d), (select coalesce(array_agg(d),'{}') from jsonb_array_elements_text(j->'delta') as d), (select coalesce(array_agg(d),'{}') from jsonb_array_elements_text(j->'grants') as d),
        convert_from(decode(j->>'create','base64'), 'UTF8'), convert_from(decode(j->>'drop','base64'), 'UTF8'), true, true
      );
raise notice 'object: % % %: %', j->'obj_typ', j->'obj_nam', j->'obj_ver', j->'delta';
    end loop;
    perform wm.check_deps();	-- no drafts to check
    perform wm.make(null, false, true);
    execute convert_from(decode(sch->>'dict','base64'), 'UTF8');
    execute convert_from(decode(sch->>'init','base64'), 'UTF8');
    return true;
  end;
$$;
